INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.74, 7, 1, 2, 3001, "vo_minigame_1012_result_1079", 9, 1, 1, 12300147, 0, "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 5);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 1, 1, 2, 3001, "vo_minigame_1012_result_1080", 9, 1, 1, 12300148, 0, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 5);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.21, 8, 1, 2, 3001, "vo_minigame_1012_result_1081", 9, 1, 2, 12300149, 0, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 5);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.46, 3, 1, 2, 3001, "vo_minigame_1012_result_1082", 9, 1, 2, 12300150, 0, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 5);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.94, 3, 1, 2, 3001, "vo_minigame_1012_result_1083", 9, 1, 2, 12300151, 0, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 5);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.19, 7, 1, 2, 3001, "vo_minigame_1012_result_1084", 9, 1, 3, 12300152, 0, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 5);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 1, 1, 2, 3001, "vo_minigame_1012_result_1085", 9, 1, 3, 12300153, 0, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 5);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.63, 3, 1, 2, 3001, "vo_minigame_1012_result_1086", 9, 1, 3, 12300154, 0, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 5);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.53, 3, 1, 2, 3001, "vo_minigame_1012_result_1087", 4, 1, 1, 12300155, 0, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 3, 3, 2, 3001, "vo_minigame_1012_result_1088", 4, 1, 1, 12300156, 9, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.15, 3, 1, 2, 3001, "vo_minigame_1012_result_1089", 4, 1, 1, 12300157, 3, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 9, 9, 2, 3001, "vo_minigame_1012_result_1090", 4, 1, 2, 12300158, 9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.37, 3, 1, 2, 3001, "vo_minigame_1012_result_1091", 4, 1, 2, 12300159, 0, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (1.44, 3, 1, 2, 3001, "vo_minigame_1012_result_1092", 4, 1, 2, 12300160, 0, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 3, 3, 2, 3001, "vo_minigame_1012_result_1093", 4, 1, 3, 12300161, 0, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.91, 3, 9, 2, 3001, "vo_minigame_1012_result_1094", 4, 1, 3, 12300162, 3, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.61, 5, 1, 2, 3001, "vo_minigame_1012_result_1095", 4, 1, 3, 12300163, 0, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 1);
