INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 4, 4, 2, 3001, "vo_minigame_1012_result_2088", 4, 2, 1, 22300156, 6, "うーん…さっぱり！\nでも簡単な問題なんだよね…？\nもっかいやってみる？", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.28, 0, 3, 2, 3001, "vo_minigame_1012_result_2089", 4, 2, 1, 22300157, 0, "うちらまだまだ\nベンキョーちうだし…\nこれからだよねっ？\nね、ヒデサイ！", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.89, 0, 3, 2, 3001, "vo_minigame_1012_result_2090", 4, 2, 2, 22300158, 0, "ちょっとずつ覚えれば\nおーけーっしょ！\nうちと一緒に\nベンキョーだね！", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.45, 0, 7, 2, 3001, "vo_minigame_1012_result_2091", 4, 2, 2, 22300159, 0, "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？", 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.29, 4, 10, 2, 3001, "vo_minigame_1012_result_2092", 4, 2, 2, 22300160, 3, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 1);
